function startSide(){const e=document.querySelector(".side");if(e){const c=document.querySelector(".menu-btn"),i=document.querySelector(".layout"),s=document.querySelector(".side__arrow");function t(){e.classList.remove("active"),i.classList.remove("active"),this.removeEventListener("click",t)}c.addEventListener("click",()=>{e.classList.add("active"),i.classList.add("active"),s.addEventListener("click",t),i.addEventListener("click",t)})}}export default startSide;